import React from 'react';
import { Link } from 'react-router-dom';

const NavBar=()=>{

    return(

<>
<div className='nav'>
  <div className='logo'>
  <Link to="/">Logo</Link>
  </div>
  <div className='nav-content'>
    <li><Link to="login">Login</Link></li>
    <li><Link to="signup">Signup</Link></li>
    <li><Link to="profile">Profile</Link></li>
  </div>
</div>
</>

      
    )
}

export default NavBar;
